import strutils, unicode


type Direction = enum
    up, down, left right

type Matrix[W, H: static[int]] =
    array[1..W, array[1..H, int]]

const keypad: Matrix[3, 3] = [[1, 2, 3],
                              [4, 5, 6],
                              [7, 8, 9]]

const minX   : int = 1
const maxX   : int = 3
const startX : int = 2
const minY   : int = 1
const maxY   : int = 3
const startY : int = 2

var currentX : int      = startX
var currentY : int      = startY
var codes    : seq[int] = @[]

proc applyStep (step: char) =
    let stepStr : char = toLowerAscii step
    if stepStr != 'u' and stepStr != 'd' and stepStr != 'r' and stepStr != 'l': return
    var direction : Direction
    case stepStr:
        of 'u' : direction = up
        of 'd' : direction = down
        of 'l' : direction = left
        of 'r' : direction = right
        else   : discard

    case direction:
        of up    : 
            if currentY > minY: currentY -= 1
        of down  : 
            if currentY < maxY: currentY += 1
        of left  : 
            if currentX > minX: currentX -= 1
        of right : 
            if currentX < maxX: currentX += 1

proc applySteps(steps: string) =
    for x in 0..steps.len:
        applyStep steps[x]

proc applyAllSteps(allSteps: string) =
    for line in splitLines allSteps:
        applySteps line
        codes.add keypad[currentY][currentX]

applyAllSteps """



